import React from 'react'

function MiComponente({rey}) {
  

  return (
    <div className='caja'>
        <h1>{rey.nombre}</h1>
        <img src={rey.img} />
        <p>Precio: <br/> {rey.precio}$</p>
        <button className='btn btn-outline-danger'>comprar</button>      
    </div>
  )
}


export default MiComponente
